sprites.onOverlap(SpriteKind.Player, SpriteKind.Skeleton, function (sprite, otherSprite) {
    if (Selected.overlapsWith(Heal1) || (Selected.overlapsWith(Heal2) || Selected.overlapsWith(Heal3))) {
        Reset_Move = 1
        for (let index = 0; index < 1; index++) {
            Slash_evil_animation()
            sprites.destroyAllSpritesOfKind(SpriteKind.Skeleton)
            Liv_ndring = -1
            MisteF_liv()
            Slash_evil_animation()
            Liv_ndring = -1
            MisteF_liv()
        }
        if (Liv > 0) {
            for (let index = 0; index < 1; index++) {
                HealAnimation()
                Liv_ndring = 2
                MisteF_liv()
            }
        }
    } else if (Selected.overlapsWith(Block1) || (Selected.overlapsWith(Block2) || Selected.overlapsWith(Block3))) {
        Reset_Move = 1
        for (let index = 0; index < 1; index++) {
            Block_animatio()
            Liv_ndring = 0
            Slash_evil_animation()
            MisteF_liv()
            Liv_ndring = -1
            MisteF_liv()
            sprites.destroyAllSpritesOfKind(SpriteKind.Skeleton)
        }
    } else if (Selected.overlapsWith(Jump1) || (Selected.overlapsWith(Jump2) || Selected.overlapsWith(Jump3))) {
        Reset_Move = 1
        Randomattack = randint(1, 10)
        Jump_animation()
        if (Randomattack >= 4) {
            for (let index = 0; index < 1; index++) {
                Slash_evil_animation()
                music.play(music.melodyPlayable(music.wawawawaa), music.PlaybackMode.InBackground)
                sprites.destroyAllSpritesOfKind(SpriteKind.Skeleton)
                Liv_ndring = -2
                MisteF_liv()
            }
        } else {
            for (let index = 0; index < 1; index++) {
                music.play(music.melodyPlayable(music.baDing), music.PlaybackMode.InBackground)
                sprites.destroyAllSpritesOfKind(SpriteKind.Skeleton)
                Liv_ndring = 0
                MisteF_liv()
            }
        }
    } else if (Selected.overlapsWith(_1Magi_1) || (Selected.overlapsWith(_1Magi_2) || Selected.overlapsWith(_1Magi_3))) {
        Reset_Move = 1
        for (let index = 0; index < 1; index++) {
            Boom_animation()
            sprites.destroyAllSpritesOfKind(SpriteKind.Skeleton)
            Liv_ndring = 0
            MisteF_liv()
        }
        Guld += 3
    } else if (Selected.overlapsWith(Slide1) || (Selected.overlapsWith(Slide2) || Selected.overlapsWith(Slide3))) {
        Reset_Move = 1
        for (let index = 0; index < 1; index++) {
            Slide_animation()
            sprites.destroyAllSpritesOfKind(SpriteKind.Skeleton)
            Liv_ndring = -3
            MisteF_liv()
        }
        Guld += 7
    } else if (Selected.overlapsWith(Sword1) || (Selected.overlapsWith(Sword2) || Selected.overlapsWith(Sword3))) {
        Reset_Move = 1
        for (let index = 0; index < 1; index++) {
            Slash_animation()
            sprites.destroyAllSpritesOfKind(SpriteKind.Skeleton)
            Liv_ndring = 0
            MisteF_liv()
        }
    } else if (Selected.overlapsWith(Blank)) {
        for (let index = 0; index < 1; index++) {
            Slash_evil_animation()
            sprites.destroyAllSpritesOfKind(SpriteKind.Skeleton)
            Liv_ndring = -2
            MisteF_liv()
        }
    } else {
    	
    }
    sprites.destroyAllSpritesOfKind(SpriteKind.Skeleton)
})
