function MisteF_liv () {
    if (Liv_ndring < 0) {
        LivSp = textsprite.create(convertToText(Liv_ndring), 0, 2)
        LivSp.setPosition(37, 50)
        Liv += Liv_ndring
        music.play(music.melodyPlayable(music.jumpDown), music.PlaybackMode.InBackground)
        Bevgelse()
    } else if (Liv_ndring > 0) {
        LivSp = textsprite.create(convertToText(Liv_ndring), 0, 7)
        LivSp.setPosition(37, 50)
        Liv += Liv_ndring
        music.play(music.melodyPlayable(music.jumpUp), music.PlaybackMode.InBackground)
        Bevgelse()
    } else {
        LivSp = textsprite.create(convertToText(Liv_ndring), 0, 8)
        LivSp.setPosition(37, 50)
        music.play(music.melodyPlayable(music.beamUp), music.PlaybackMode.InBackground)
        Bevgelse()
    }
}
